  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes implementation of
  the National Wildlife Refuge System's I&M program during FY 2013 and FY 2014. This
  annual report describes implementation of the National Wildlife Refuge System's
  Inventory and Monitoring (I&M) program during FY 2013 and FY 2014; results from
  all eight regions and the I&M Branch of the Natural Resource Program Center have
  been compiled in this report. The introduction discusses goals and focus areas in
  the program as well as integration with Regional Refuge Biology. Public interest
  highlights, staffing, I&M accomplishments, and the budget are also summarized. A
  table of I&M program activities is attached.\",\n\t\"license_title\": \"License
